import React, {Component} from 'react';
//import { Button } from '../Button';
import {MenuItems} from "./MenuItems"
import './Navbar.css'
import {Link, BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Aspirantes from '../Aspirantes/Aspirantes';
import Profesores from '../Profesores/Profesores';
import Estudiantes from '../Estudiantes/Estudiantes';
import PropTypes from 'prop-types'

class Navbar extends Component{
    state = {clicked: false}

    PropTypes = {

    }

    handleClick = () => {
        this.setState({clicked: !this.state.clicked})
    }

    render(){
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">Facultad de Ingenier√≠a y Ciencias<i className="fab fa-react"></i></h1>
                <div className="menu-icon"onClick={this.handleClick}>
                    <i className={this.state.clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
                </div>
                <ul className={this.state.clicked ? 'nav-menu active' : 'nav-menu'}>
                    {MenuItems.map((item, index) => {
                        return(
                            <Router>
                                <nav>
                                    <li key={index}>
                                        <a className={item.cName} href={item.url}>
                                            <Link to={item.url} className="text-link" replace>{item.title}</Link>
                                        </a>
                                    </li>
                                </nav>
                                <Switch>
                                    <Route path="/Aspirantes" component={Aspirantes}/>
                                    <Route path="/Estudiantes" component={Estudiantes}/>
                                    <Route path="/Profesores" component={Profesores}/>
                                </Switch>
                            </Router>
                        )
                    })}
                </ul>
            </nav>

        )
    }
}

export default Navbar
